import React from "react";
import style from "./Profile.module.css"
import ProfileInfo from "./ProfileInfo/ProfileInfo";
import ProfileDescriptioContainer from "./ProfileDescription/ProfileDescriptioContainer";


const Profile = (props) => {
    return (
        <div className={style.profile}>
            <div>
                <ProfileInfo className={style.profileEditing}
                              profile={props.profile}
                              isOwner={props.isOwner} savePhoto={props.savePhoto}/>
            </div>

            <div>
                <ProfileDescriptioContainer className={style.profileInfo} state={props.state}
                                            profile={props.profile} dispatch={props.dispatch} status={props.status}
                                            getStatus={props.getStatus} updateStatus={props.updateStatus}/>
            </div>
        </div>
    )
}

export default Profile
